import postal from "../Assets/IndiaPostLogo.png";

const Navigation = () => {
  return (
    <div className="m-6">
      <nav
        className="flex-1  space-x-3 bg-red-600  p-3 
      rounded-lg text-amber-300 font-bold text-xl"
      >
        <img
          src={postal}
          className="h-6 rounded-full"
          alt="IndiaPostLogo"
        ></img>
        
          <h1>home</h1>
          <h1>About</h1>
          <h1>Contact</h1>
       
      </nav>
    </div>
  );
};

export default Navigation;
